import React from 'react';
import { Card } from 'reactstrap';
const Consumi = () =>{
    let listaConsumi = [
        {
            km : 400,
            litri : 32.7,
            commento : "fuzinona"
        },
        {
            km : 500,
            litri : 33.7,
            commento : "fuzinona"
        },
        {
            km : 560,
            litri : 2345.7,
            commento : "funziona"
        },
    ];


    return(
        listaConsumi.map((value)=> {
            let { km, litri, commento } = value;
            return(
                 <DivConsumo km={km} litri={litri} commento={commento}/>
            )
        })
    );
}

const DivConsumo = (props) =>
{
    const {km, litri, commento} = props;

    return(
        <Card style={{ width: '100%',marginBottom:"10px",marginTop:"10px"}}>
                                   <Card.Body>
                                       <Card.Title>Francesco Verdi</Card.Title>
                                       <Card.Subtitle className="mb-2 text-muted">15 anni</Card.Subtitle>
                                       <Card.Text>
                                           Sono un ragazzo di 15 anni che studia alle superiori e fa sport.
                                           Se premi sul bottone scoprirai che sport faccio!
                                       </Card.Text>
                                       <button className="view-button" onClick={() => onClickFunction("Calcio")}>Vedi Sport</button>
                                   </Card.Body>
                               </Card>
        /*<Card>
            <div className={"col-md-3"}>
                {km}
            </div>
            <div className={"col-md-3"}>
                {litri}
            </div>
            <div className={"col-md-3"}>
                {commento}
            </div>
        </Card>*/
    );
}
export default Consumi;
